import React, { useContext } from 'react'
import { useNavigate } from 'react-router-dom'
import { Button } from '../UI/Button/Button';
import { NavLink } from 'react-router-dom';
import { userContext } from '../../userContext';

export const Nav = () => {

    const navigate = useNavigate();
    const user = useContext(userContext)
    const redirectLogin = () => navigate('/login')


    return (
        <div className="flex w-full justify-between py-5 px-10 font-mono">
            <section className="flex w-2/5 justify-between font-bold">
                <p className=" cursor-pointer"><NavLink to="/">HOME</NavLink></p>
                <p>PRICING</p>
                <p>WHY TOUCH</p>
                <p>BLOG</p>
            </section>  

            <section className="flex justify-between">
                <Button onClick={redirectLogin} name={user.email ? "LOGOUT" : "LOGIN"}/>
            </section>
        </div>
    )
}
